import React, { Component } from 'react';
import { hubStock as hubData } from './data/hubStock';
import { googStock as googData } from './data/googStock';
import ChartD3 from './Chart3.jsx';
import * as _ from 'lodash';

class Chart3Page extends Component {

  render() {
    let content1, content2;
    content1 = <ChartD3 data="_.cloneDeep(hubData)" title="Hub Stock" />;
    content2 = <ChartD3 data="_.cloneDeep(googData)" title="Google Stock" />;

    return (
      <div className="App">
        <div className="App-header">
          <h2>Charts and google maps with React.</h2>
        </div>
        <div className="container">

          {content1}

        </div>
        <div className="container">

          {content2}

        </div>
      </div>
    );
  }
}

export default Chart3Page;
